import React from 'react'

const Person = ({ person }) => {
    return (
        <div>
            {person.name} {person.number} <button value='delete' />

        </div>
    )
}



const ListPeople = (props) => {
    return (
        <div>
            {props.namesToShow.map((name) =>
                <Person key={name.name} person={name} />

            )}

        </div>
    )
}

export default ListPeople
